import './App.css';
import CategoryList from './components/CategoryList';

import Header from './components/Header';

function App() {
  return (
    <Router>
    <div>
      <Header/> 
      <Routes>
          <Route path="/" element={<CategoryList/>} />
        </Routes>
    </div>
    </Router>
  );
}

export default App;
